import {useParams} from "react-router-dom";
function MovieDetail({data}) {
  const {id} = useParams();
  console.log(id);
  console.log("Data Movie Detail:", data);
  return (
    <div>
      {data.map((film) => (
        <div>{film.id}</div>
      ))}
    </div>
  );
}

export default MovieDetail;
